import {Route, Routes } from 'react-router-dom';


function App() {
  return (

    <div className='App'>
      <Routes>
        <Route path="\" element={ <Main/> } />
        {/* <Route path="carPage" element={ <CarPage/> } /> */}
        </Routes>
    </div>
  );
}

export default App;
